Pregnant? Just track your pregnancy week by week using Pregnancy App.

With Pregnancy App you can easily: 
- track your pregnancy;
- get information about your pregnancy;
- get current pregnancy week and use pregnancy calendar;
- calculate due date (pregnancy date);
- manage contractions with contraction counter
- track kicks with kick counter
- track your pregnancy weight

Pregnancy Tracker is very helpful for a pregnant woman.
Free pregnancy app. 
Powered by Amila.

Timely replacement of contact lenses is the key to healthy eyes. In order not to forget to change lenses on time - use the contact lens tracker application.

In the app you can:
-Store unlimited pairs of contact lenses and keep track of all on one screen;
- Specify the number of days for the lenses and manually update the counter;
- Specify the start date of the lenses and get notified on the end day (Pro);
- Complete contact lens details including color.
